import React from 'react';
import Template from './Templates/Simple';
import CvForm from './CvForm/CvForm';
import styled from 'styled-components';


const Half = styled.div`
  width: 45%;
  display: flex;
  flex-direct: row;
`


const App = () => {
    return (
        <React.Fragment>
            <Half>
                <Template/>
            </Half>
            <Half>
                <CvForm/>
            </Half>
        </React.Fragment>
    )
  }

export default App;
